    const sendOtp = async () => {
        await axios({
            method: 'post',
            url: 'http://127.0.0.1:8000/auth/verify/',
            headers: {
                'Content-Type': 'application/json'
            },
            data: {
                'email':otpDetails.email,
                'otp': otpDetails.otp
            }
        }).then((response) => {
            console.log(response.data)
            // console.log(response.status)
            if (response.data.status == 200) {
